import React from 'react';
import PropTypes from 'prop-types';
import FormItem from '../../../../shared/Form/FormItem/FormItem';
import Input from '../../../../shared/Input/Input';
import Button from '../../../../shared/Button/Button';
import { ROUTES } from '../../../../../config/constants';
import { Link } from 'react-router-dom';

const EnterTelegramId = props => {
    return (
        <div className='bg-white h-72 p-7 rounded-md shadow flex flex-col justify-between'>
            <div>
                <h2 className='mb-7 text-2xl font-medium text-gray-800'>Enter Telegram ID</h2>
                <p className='text-gray-700 text-xl mb-5'>Please enter your Telegram ID below</p>
                <FormItem helpMessage label={'Telegram ID'}>
                    <Input type={'text'} />
                </FormItem>
            </div>

            <div className='flex justify-center items-center'>
                <Button type={'link'} className={'mr-5'}>
                    Previous
                </Button>
                <Button type={'primary'} className={'bg-indigo-600 hover:bg-indigo-700'}>
                    Connect
                </Button>
            </div>
        </div>
    );
};

EnterTelegramId.propTypes = {};

export default EnterTelegramId;
